import React from 'react';

export default function Tile(props){
     let name
        if (props.c===2 || props.c===5) {
            name = "singleTileThickC"
        } else if (props.r===3 || props.r===6){
            name = "singleTileThickR"
        } else {
            name = "singleTile"
        }
    return(
        <div className= {name}>
            <h2 className="number"> {props.number} </h2>
            <h2 > {props.r} </h2>
            <h2 > {props.c} </h2>
        </div>
    )
}
